<p>This is the code I have written to do so. When this runs from a sandbox I made in VisualStudio using a MongoDB add on it runs fine, however when ran using my app, only the message document is added and without any error it appears to skip the aggregation to the member document.</p>
<p>Here is the code I am using to insert the documents to the database and to aggregate once the document is inserted:</p>
<pre class="lang-js prettyprint-override"><code>await mongodb.collection(&quot;Messages&quot;).updateOne({ _id: reaction.message.id.toString()},
        { 
            $set:{
            authorid: reaction.message.author.id,
            author: reaction.message.author.username
            },

            $push: { 
                reactions: { 
                reauth: reAuth, 
                reaction: reaction.emoji.name, 
                removed: false, 
                value: actualKarmaDB,
                }
            }
            }, {safe: true, &quot;upsert&quot;: true})

    await mongodb.collection(&quot;Messages&quot;).aggregate([
    {
            $match: { 
                _id: reaction.message.id
            }
    },
    {
        $project: {
            _id: &quot;$authorid&quot;,
            username: &quot;$author&quot;,
            messageKarma: {$sum: &quot;$reactions.value&quot;},
            }

    },
    {   $merge: { 
            into: &quot;Members&quot;, 
            on: &quot;_id&quot;, 
            whenMatched: &quot;replace&quot;, 
            whenNotMatched: &quot;insert&quot; 
            } 
    }])

</code></pre>
